    expected = '\n'.join(
    "44th 193rd 188th 18th 67th 194th 59th 185th 148th 40th 106th 104th 170th 62nd 109th 191st 111th 164th 180th 113th 174th 151st 12th 53rd 99th 14th 78th 108th 55th 197th 36th 70th 87th 97th 124th 34th 4th 157th 117th 140th 82nd 118th 107th 153rd 77th 24th 102nd 25th 135th 98th 76th 156th 84th 43rd 158th 121st 6th 139th 42nd 75th 123rd 175th 7th 56th 58th 150th 72nd 31st 20th 11th 48th 69th 13th 74th 29th 110th 126th 32nd 127th 38th 122nd 15th 17th 187th 50th 152nd 92nd 112th 163rd 94th 100th 1st 195th 144th 142nd 66th 133rd 101st 9th 125th 160th 165th 26th 147th 182nd 119th 199th 177th 23rd 5th 19th 167th 10th 30th 141st 89th 173rd 0th 183rd 154th 22nd 63rd 114th 120th 115th 83rd 27th 166th 68th 189th 161st 143rd 181st 103rd 186th 198th 2nd 95th 52nd 51st 81st 47th 176th 168th 28th 128th 131st 35th 146th 116th 49th 41st 149th 192nd 190th 86th 159th 39th 155th 105th 79th 65th 80th 137th 169th 85th 37th 8th 184th 134th 90th 33rd 21st 60th 136th 3rd 179th 178th 132nd 64th 93rd 88th 16th 73rd 96th 91st 54th 196th 162nd 57th 171st 145th 61st 129th 46th 172nd 71st 130th 45th 138th".split()
    )
    with StringIO() as output:
        with redirect_stdout(output):
            runpy.run_path("ordinal.py")
